  demoUsingTTFFont() {
    const AmiriRegular = "";
    const doc = new jsPDF({ filters: ['ASCIIHexEncode'] });
    
  
    doc.addFileToVFS("Amiri-Regular.ttf", AmiriRegular);
    doc.addFont('Amiri-Regular.ttf', 'Amiri', 'normal');
  
    doc.setFont('Amiri'); // set font
    doc.setFontSize(15);
  
  
    doc.text("إذا لم تستح فاصنع ما شئت", 10, 10);
  
    doc.save('test.pdf');
  }
  savePDF(columns, fields, data:any, fileName: string) {
    var doc = new jsPDF({orientation: 'landscape'});    
    var rows = [];
    data.forEach(item => {
      let fieldData = []
      fields.forEach(fieldName => {
        fieldData.push(item[fieldName])
      });
      rows.push(fieldData)
    })

    doc.autoTable(columns, rows);
    doc.save(fileName);
  }
  savePDF1(columns, fields, data:any, fileName: string) {
     var font = '';
    const doc = new jsPDF({ filters: ['ASCIIHexEncode'] });
    
  
    doc.addFileToVFS('Nunito-Regular-normal.ttf', font);
    doc.addFont('Nunito-Regular-normal.ttf', 'Nunito-Regular', 'normal');
    doc.setFont('Nunito-Regular'); // set font
    doc.setFontSize(25);  
    //doc.text("Font test", 10, 10);
    
    
    var rows = [];
    data.forEach(item => {
      let fieldData = []
      fields.forEach(fieldName => {
        fieldData.push(item[fieldName])
      });
      rows.push(fieldData)
    })

    doc.autoTable(columns, rows);
    doc.save(fileName);

    ///this.addFont()
  }

